		  gsub(/\\\$\$/, "\\\\\$", loc);
		  gsub(/\\&/,"\\\\\\\\&",loc)
		  print " \\\\\\n\\t \\"/" dir "\\"", "\\"://" key "/" loc "\\""
		}
	END 	{ if (!first) print "\\n"; else exit 1 }
	'

EOF
